  -moz-transform: rotate(45deg);
  transform: rotate(45deg);
  margin: 25px;
  cursor: pointer;
}
.box:hover:not(.links) > .box-face, .box:hover > .box-back {
  transform: translateZ(100px) rotateX(180deg);
  background-color: transparent !important;
}
.box:hover:not(.links) > .box-face > .box-text {
  opacity: 0;
}
.box:hover .tooltip {
  visibility: visible;
  opacity: 1;
}
.box:hover.links > .box-face {
  background-color: transparent !important;
}
.box:hover.links > .box-face > .box-text {
  color: #323232;
}
.box.links > .box-face {
  background-color: #323232;
  border: 1px solid #323232;
  box-sizing: border-box;
  transition: background-color 0.5s;
}
.box.links.links:hover {
  background-color: #dedede;
}
.box.links .box-text {
  color: #efefef;
  transition: color 0.5s;
}

.box-face, .box-back {
  position: absolute;
  top: 0;
  z-index: 1;
  width: 100px;
  height: 100px;
  background-color: #dedede;
  -webkit-transform: rotate(-90deg);
  -ms-transform: rotate-(90deg);
  -moz-transform: rotate(-90deg);
  transform: rotate(-90deg);
  transform-style: preserver-3d;
  -webkit-transform-style: preserver-3d;
  -moz-transform-style: preserver-3d;
  transition: transform 1s, background-color 0s 0.3s;
}

.box-face .box-text {
  line-height: 100px;
  text-align: center;
  font-size: 40px;
  color: #bababa;
  -webkit-transform: rotate(135deg);
  -ms-transform: rotate(135deg);
  -moz-transform: rotate(135deg);
  transform: rotate(135deg);
  transition: opacity 0s linear 0.3s;
}

.box-back .box-text {
  line-height: 100px;
  text-align: center;
  font-size: 12px;
  color: #636363;
  -webkit-transform: rotate(135deg);
  -ms-transform: rotate(90deg);
  -moz-transform: rotate(90deg);
  transform: rotate(135deg) rotateY(180deg);
