  color: #151515;
  font-family: "Neue Montreal Regular", sans-serif;
  width: 40%;
  font-size: 20px;
  margin-top: 60px;
}
.modal__container__image__container {
  display: flex;
  width: 65%;
  height: auto;
  margin-top: 50px;
}
.modal__container__image {
  width: 100%;
