}

.booki__button {
  position: relative;
  bottom: 130px;
}

.booki__tags {
  position: relative;
  bottom: 90px;
}

.description__image__container {
  display: flex;
  flex-direction: row;
  width: 100%;
  height: auto;
  gap: 20px;
}

.tags__container {
  display: flex;
  flex-direction: row;
  width: 50%;
  gap: 10px;
  padding: 20px 0;
}
.tags__container__layout {
  display: flex;
  justify-content: center;
  align-items: center;
  width: 15%;
  height: 33px;
  border-radius: 50px;
  background-color: rgb(56, 56, 56);
}
.tags__container__layout--tags {
  color: #FFFFFF;
  text-align: center;
  padding: 2px;
}

.project__button {
  position: relative;
  border: none;
  cursor: pointer;
  width: 190px;
  height: 125px;
  background: none;
  color: #FFFFFF;
}
.project__button:before, .project__button:after {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
}
.project__button:before {
  content: "";
  background: #151515;
  border-radius: 30% 70% 70% 30%/30% 30% 70% 70%;
  clip-path: path("M154.5,88.5 C131,113.5 62.5,110 30,89.5 C-2.5,69 -3.5,42 4.5,25.5 C12.5,9 33.5,-6 85,3.5 C136.5,13 178,63.5 154.5,88.5 Z");
  transition: clip-path 0.5s cubic-bezier(0.585, 2.5, 0.645, 0.55);
}
.project__button:hover:before {
  clip-path: path("M143,77 C117,96 74,100.5 45.5,91.5 C17,82.5 -10.5,57 5.5,31.5 C21.5,6 79,-5.5 130.5,4 C182,13.5 169,58 143,77 Z");
}
.project__button span {
  mix-blend-mode: difference;
}
.project__button:after {
  content: "";
  height: 80%;
  width: 90%;
  top: 6px;
  border: 1px solid #151515;
  border-radius: 58% 42% 55% 45%/56% 45% 55% 44%;
  transform: rotate(-20deg);
  transition: transform 0.5s cubic-bezier(0.585, 2.5, 0.645, 0.55);
}
.project__button:hover:after {
  transform: translate3d(0, -5px, 0);
}
.project__button__text {
  position: absolute;
  top: 40px;
  left: 50px;
  font-size: 20px;
  text-align: center;
}

.modal-cross {
  position: absolute;
  width: 65px;
  top: 30px;
  right: 30px;
  cursor: pointer;
  filter: invert(97%) sepia(0%) saturate(7482%) hue-rotate(90deg) brightness(108%) contrast(102%);
}

