@import url('https://fonts.googleapis.com/css2?family=Abril+Fatface&display=swap');
@import url('https://fonts.googleapis.com/css2?family=Playfair+Display:ital,wght@0,400;0,500;0,600;0,700;1,400;1,500;1,600;1,700&display=swap');

@font-face {
    font-family: 'Neue Montreal Regular';
    src: url('../fonts/neue-montreal/NeueMontreal-Regular.otf') format('otf');
}
@font-face {
    font-family: 'Neue Montreal Light';
    src: url('../fonts/neue-montreal/NeueMontreal-Light.otf') format('otf');
}


// Font
$text-font: 'Neue Montreal Regular', sans-serif;
$text-font-light : 'Neue Montreal Light', sans-serif;
$title-font: 'Abril Fatface', sans-serif;
$third-font: 'Playfair Display', serif;

// Color
$white-color: #FFFFFF;
// $black-color: #0e0e0e;
$black-color: #151515;
$green-color: #5fcf77;

sources.assets\\styles\\base.scss:
@import './variables.scss';

* {
    margin: 0;
    box-sizing: border-box;
    &:after,
    &:before {
        box-sizing: border-box;
    }
}

* {
    scrollbar-width: thin;
}

/* Works on Chrome, Edge, and Safari */
*::-webkit-scrollbar {
    width: 10px;
    background-color: rgb(53, 52, 52);
    border-radius: 20px;

}

*::-webkit-scrollbar-thumb:hover {
    border: 1px solid rgb(56, 56, 56);
}

*::-webkit-scrollbar-thumb {
    background-color: rgb(35, 35, 35);
    border-radius: 20px;
    border: 1px solid rgb(40, 40, 40);
}

html,
body {
    overflow-x: hidden;
}

body {
    background-color: #000;
    color: $white-color;
    font-family: $text-font-light;
    line-height: 1.5;
    -webkit-font-smoothing: antialiased;
}

button,
input,
textarea,
select {
    font: inherit;
}

p,
h1,
h2,
h3,
h4,
h5,
h6 {
    overflow-wrap: break-word;
}

img,
video,
canvas,
svg {
    max-width: 100%;
}

a {
    text-decoration: none;
    color: inherit;
}
ul {
    list-style: none;
    display: block;
    margin-block-start: 0;
    margin-block-end: 0;
    margin-inline-start: 0px;
    margin-inline-end: 0px;
    padding-inline-start: 0;
}
.title {
    user-select: none; /* -- Prevent image highlighting -- */
}

sources.assets\\styles\\loader.scss:
@import './variables.scss';

.loader {
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    height: 100vh;
    width: 100%;
    z-index: 99;
    background: #000;
    display: grid;
    place-items: center;
    font-family: $third-font;
    font-style: italic;
    font-weight: 300;

    display: none;

    &__box {
        position: relative;
        width: 500px;
        height: 200px;
        @media (max-width: 780px) {
            & {
                width: 90vw;
            } 
        }
    }
    &__bar {
        width: 40%;
        height: 9px;
        position: absolute;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        background: $white-color;
        border-radius: 10px;
        cursor: pointer;
    }
    &__bar--inner {
        height: 100%;
        width: 0;
        border-radius: 10px;
        opacity: 0.7;
        background-image: radial-gradient(circle at left, rgb(71, 71, 71),rgb(8, 8, 8));
    }
    &__text--container {
        display: flex;
        align-items: center;
        justify-content: center;
        margin-top: 20px;
        cursor: pointer;
    }
    &__text--break {
        overflow: hidden;
    }
    &__text {
        position: relative;
        color: $white-color;
        padding: 1rem;
        font-size: 25px;
        animation: swipe 4s ease-in-out  infinite;
        overflow: hidden;
   
        @keyframes swipe {
            from {
                margin-right: -600px;
                opacity: 0;

            }
            to {
                margin-right: 0;
                opacity: 1;
            }
        }
    }
    &__text2 {
        position: relative;
        color: $white-color;
        padding: 1rem;
        font-size: 25px;
        animation: swipe2 4s ease-in-out -1.5s infinite;
        @keyframes swipe2 {
            from {
                margin-right: -600px;
                opacity: 0;
            }
            to {
                margin-right: 0;
                opacity: 1;
            }
        }
    }

    &__slash {
        font-weight: bold;
        animation: pulse 1s ease-in-out infinite;
        @keyframes pulse {
           from {
            opacity: 0;
           } 
           to {
            opacity: 1;
           }
        }
    }
    &__border {
       width: 90%;
       height: 1px; 
       background: $white-color;
       position: absolute;
       left: 50%;
       transform: translatex(-50%);
    }
    &__counter {
        position: absolute;
        margin-top: 75px;
        color: $white-color;
        font-family: $title-font;
        font-size: 18px;
        font-weight: 300;
        cursor: default;
    }
    &__counter.active {
        animation: counterScale 0.5s linear forwards;
        @keyframes counterScale {
            from {
                scale: 1;
            }
            to {
                scale: (var(--vw-scale)); 
                margin-top: 100px;
            }
        }  
    }
}

.layout {
    width: calc(100vw - 85%);
    height: 100vh;
    position: absolute;
    right: calc(100vw - 148%);
     opacity: 0.3;
     background-image: linear-gradient(to right, $black-color, rgb(71, 71, 71), $black-color);
}

.background {
    position: absolute;
    width: 500px;
    height: 150px;
    border: 3px solid $white-color;
    border-radius: 50%;
    visibility: hidden;
    cursor: default;

    &__svg {
        position: absolute;
        top: 50%;
        left: 50%;
        width: 100%;
        transform: translate(-50%, -50%);
        opacity: 0;
    }
}


// Background noise animation
.opacity__overlay {
    background: $black-color;
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    z-index: -1;
    opacity: 0.5;
}
.noise::before {
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    content: "";
    opacity: 0.1;
    z-index: -1;
    pointer-events: none;
    background: url("../images/noise400.gif");
}

// Media queries //

@media screen and (max-width: 1024px) {
    .loader__counter.active {
        margin-bottom: 100px;
    }
}

sources.assets\\styles\\landing.scss:
@import "./breakpoints.scss";

// Mouse animation

.cursor {
    pointer-events: none;
    position: fixed;
    display: block;
    border-radius: 0;
    mix-blend-mode: difference;
    top: 0;
    left: 0;
    z-index: 9999;
    

    // Media queriess
    @include tablet {
        display: none;
    }
}
  
.circle {
    position: absolute;
    display: block;
    width: 24px;
    height: 24px;
    border-radius: 20px;
    background-color: #FFFFFF;
}

  
.landing {
    position: relative;
    width: 100%;
    height: 100vh;
    color: $white-color;
    overflow: hidden;
    .header {
        position: absolute;
        left: 50%;
        transform: translateX(-50%);
        width: 100%;
        z-index: 10;
        
        // Media queries
        @include mobile {
            position: fixed;
            width: 100%;
            height: 55px;
            background-color: $black-color;
        }
        &__name {
            position: absolute;
            left: 40px;
            font-size: 19px;
            padding-top: 18px;
            // Media queries
            @include mobile {
                padding-top: 18px;
            }
        }
        &__wrapper {
            display: flex;
            align-items: center;
            justify-content: center;
            padding: 10px;
            width: 100%;
            padding-top: 20px;

            @include mobile {
                display: none;
                flex-direction: column;
                justify-content: center;
                align-items: center;
                padding: 0;
                z-index: 99;
                width: 100vw;
                height: 100vh;
                background: #000;
                position: absolute;
                padding: 0;
                top: -1000px;
                border-bottom: 1px solid $white-color;
            }
        }
        &__wrapper.active {
            display: flex;
            overflow-y: hidden;
            margin-top: 0;
            animation: dropDown 1s ease-in-out forwards;
            z-index: 99;

            @keyframes dropDown {
                to {
                    top: 0;
                }
            }
        }
        &__wrapper.remove {
            animation: removeDropDown 1s ease-in-out forwards;

            @keyframes removeDropDown {
                from {
                    top: 0;
                }
                to {
                    top: -1000px;
                }
            }
        }
        &__closeDropDown {
            position: absolute;
            right: 20px;
            top: 17px;
            font-size: 19px;
            font-weight: 300;
            visibility: hidden;
            @include mobile {
                visibility: visible;
            }
        }
        &__left {
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 2rem;
            & li {
                font-size: 18px;
                font-weight: 700;
            }

            // Media queries
            @include tablet {
                gap: 0.9rem;
            }
            @include mobile {
                flex-direction: column;
                padding: 0;
            }
        }
        &__right {
            position: absolute;
            right: 50px;

            // Media queries
            @include mobile {
                display: flex;
                justify-content: center;
                position: relative;
                width: 100%;
            }
        }
        &__border {
            height: 1px;
            background-color: $white-color;
            width: 100vw;
            position: absolute;
            top: 60px;
            z-index: -1;
            @include mobile {
                top: 55px;
            }
        }
            // Media queries
            // Hide some categories from navbar
            @include tablet {
                &__sm {
                    display: none;
                }
            }
    }
}

.dropDown {
    display: none;

    // Media queries
    @include mobile {
        display: flex;
        position: absolute;
        right: 20px;
        top: 17px;
    }
    &__hamburger {
        width: 23px;
    }
    &__hamburger.active {
        transform: rotate(-180deg);
        transition: transform 0.3s ease-in-out;
    }
}

.socials {
    position: absolute;
    left: 50%;
    transform: translateX(-50%);
    bottom: 9rem;
    display: flex;
    align-items: center;
    gap: 1.1rem;
    z-index: 5;
}

.scrollDown {
    position: absolute;
    bottom: 3rem;
    left: 50%;
    bottom: 20px;
    opacity: 0.8;
    transform: translateX(-50%);
    z-index: 1;
    cursor: pointer;
    &__wheel {
        height: 42px;
        width: 24px;
        border-radius: 10px;
        border: 2px solid $white-color;
        &--inner {
            position: absolute;
            left: 10px;
            margin-top: 5px;
            width: 4px;
            height: 4px;
            background: $white-color;
            border-radius: 50%;
            animation: movingWheel 0.5s linear infinite;
            @keyframes movingWheel {
                0% {
                    top: 1px;
                }
                25% {
                    top: 2px;
                }
                50% {
                    top: 3px;
                }
                75% {
                    top: 2px;
                }
                100% {
                    top: 1px;
                }
            }
        }
    }
    &__arrows {
        display: flex;
        flex-direction: column;
        align-items: center;
    }
    &__arrow {
       width: 15px;
       height: 15px;
       border-right: 2px solid $white-color; 
       border-bottom: 2px solid $white-color; 
       transform: rotate(45deg);
       animation: scrollAnimation 0.3s infinite;
       animation-direction: alternate;
       @keyframes scrollAnimation {
        0% {
            opacity: 0;  
        }
        50% {
            opacity: 0.5;  
        }
        100% {
            opacity: 1;  
        }
       }
    }
}

// Introduction text
.introduction {
    position: absolute;
    width: 100%;
    height: 100vh;
    right: 100%;
    display: flex;
    justify-content: center;
    align-items: center;
    // mix-blend-mode: difference;

    &__image {
        position: absolute;
        width: 100%;
        height: 100%;
        z-index: -2;
    }

    &__picture {
        width: 100%;
        height: 100%;
        object-fit: cover;
        object-position: center;
    }


    &__container {
        display: flex;
        padding: 0 50px;

        // Media queries
        @include desktop {
            padding: 0 40px;
        }
        @include tablet {
            padding: 0 30px;
        }
        @include mobile {
            padding: 0 20px;
        }
    }
    &__hey {
        font-family: $third-font;
        font-style: italic;
        font-size: 80px;
        font-weight: 100;
        cursor: none;
        
        // Media queries
        @include desktop {
            font-size: 60px;
        }
        @include tablet {
            font-size: 45px;
        }
        @include mobile {
            font-size: 30px;
        }
    }
    &__title {
        position: relative;
        font-size: 60px;
        font-weight: 300;
        top: 25px;
        left: 12px;
        cursor: none;

        // Media queries
        @include desktop {
            font-size: 40px;
        }
        @include tablet {
            font-size: 30px;
            top: 18px;
        }
        @include mobile {
            font-size: 23px;
            top: 9px;
            left: 6px;
        }
    }
    &__container--txt {
        padding: 0 50px;
        font-weight: 400;

        // Media queries
        @include desktop {
            padding: 0 40px;
        }
        @include tablet {
            padding: 0 30px;
        }
        @include mobile {
            padding: 0 20px;
        }
    }
    &__text {
        font-size: 30px;
        font-weight: 300;
        line-height: 30px;
        cursor: none;

        // Media queries
        @include desktop {
            font-size: 25px;
        }
        @include tablet {
            font-size: 20px;
        }
        @include mobile {
            font-size: 17px;
        }
    }
}

sources.assets\\styles\\breakpoints.scss:
$breakpoints: (
    "desktop": 1024px,
    "tablet": 768px,
    "mobile": 480px,
);

@mixin desktop {
    @media screen and (max-width: map-get($breakpoints, "desktop")) {
        @content;
    }
}

@mixin tablet {
    @media screen and (max-width: map-get($breakpoints, "tablet")) {
        @content;
    }
}

@mixin mobile {
    @media screen and (max-width: map-get($breakpoints, "mobile")) {
        @content;
    }
}

sources.assets\\styles\\animatedLinks.scss:
@import './breakpoints.scss';

// Navbar links animation
.animatedLinks {
    position: relative;
    display: grid;
    place-items: center;
    overflow: hidden;
    font-weight: 300;
    font-size: 17px;

    // Media queries
    @include desktop {
        font-size: 15px;
    }
    @include tablet {
        font-size: 13px;
    }
    @include mobile {
        font-size: 50px;
    }
    &:before {
        content: "";
        position: absolute;
        bottom: 2px;
        left: 0;
        width: 100%;
        height: 1px;
        background-color: currentColor;
        transform: scale3d(0, 1, 1);
        transform-origin: right;
        transition: transform 0.3s cubic-bezier(0.5, 0.5, 0.3, 1);
    }
    &:after {
       content: attr(data-text);
       position: absolute;
       bottom: 2px;
       height: 100%; 
       transform: translate3d(150%, 0, 0);
